import * as React from "react";
import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import ButtonAppBar from './ButtonAppBar';

import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';


import Box from '@mui/material/Box';
import Button from '@mui/material/Button'
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import CircleIcon from '@mui/icons-material/Circle';
import ChildCareIcon from '@mui/icons-material/ChildCare';



const Select = () => {

    const [data, setData] = useState([]);
    let navigate = useNavigate();

    const getData = async () => {
        await fetch('db.json', {
            headers: {
                'Content-Type': 'application/json',
                'Accept': 'application/json'
            }
        })
            .then((res) => res.json())
            .then((res) => {
                console.log(res);
                setData(res);
            });
    };

    useEffect(() => {
        const getDataAsync = async () => {
            await getData();
        }
        getDataAsync();
    }, []);



    const addPackage = async () => {

        let arr = [];

        await fetch('db.json', {
            headers: {
                'Content-Type': 'application/json',
                'Accept': 'application/json'
            }
        })

        const requestOptions = {
            method: 'PUT',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify()
        };


    }

    return (
        <>
            <ButtonAppBar />
            <div className="select-header">
                <h1 className="select-h1">Våra paket</h1>
                <p className="select-p"> Välj mellan 3 olika storlekar nedan. <br />
                    Alla paket kommer i blandade färger.
                </p>
            </div>
            <div className='accordion-menu'>
                {
                    data.package !== undefined && data.package !== null &&
                    data.package.map((item, index) => {
                        return (
                            <Accordion key={index}>
                                <AccordionSummary
                                    expandIcon={<ExpandMoreIcon />}
                                    aria-controls="panel1a-content"
                                    id={`panel${index + 1}a-header`}
                                >
                                    <Typography className={`option-${index + 1}`}>
                                        {item.size}
                                    </Typography>
                                </AccordionSummary>
                                <AccordionDetails className={`option-${index + 1}`}>
                                    <Box sx={{ width: '100%', maxWidth: 360, bgcolor: 'background.paper' }}>
                                        <List>
                                            {
                                                item.content.map((x, index) => {
                                                    return (
                                                        <ListItem key={index} disablePadding>
                                                            <ListItemButton>
                                                                <ChildCareIcon sx={{ pr: '5px' }} />
                                                                <ListItemText primary={x} />
                                                            </ListItemButton>
                                                        </ListItem>
                                                    )
                                                })
                                            }
                                        </List>
                                    </Box>
                                    <Button sx={{
                                        backgroundColor: '#F3A358',
                                        margin: 'auto',
                                        width: '90%',
                                        height: '2.5rem',
                                        fontWeight: 'bold',
                                        color: 'white',
                                        fontSize: '1rem',
                                        left: '50%',
                                        marginLeft: '-45%',
                                        position: 'absolute',
                                        bottom: 0,
                                    }}
                                        onClick={() => { console.log(item.id); navigate('/Confirm') }}>
                                        VÄLJ
                                    </Button>
                                </AccordionDetails>
                            </Accordion>
                        )
                    })
                }
            </div>
        </>
    );
}

export default Select;
